WITH RECURSIVE numbers AS (
    SELECT 1 AS device_id
    UNION ALL
    SELECT device_id + 1
    FROM numbers
    WHERE device_id < 1344
)
    id,
    user_id,
    device_id,
    allocated_on,
    deallocated_on,
    used_by
)
SELECT
    device_id,
    CASE
        WHEN device_id <= 336 THEN 1
        WHEN device_id <= 672 THEN 2
        WHEN device_id <= 1008 THEN 3
        ELSE 4
    END AS user_id,
    device_id,
    '2023-04-19 10:00:00',
    NULL,
    CASE
        WHEN device_id <= 336 THEN 'rahul.bhandari'
        WHEN device_id <= 672 THEN 'rahul.bhandari'
        WHEN device_id <= 1008 THEN 'neha.verma'
        ELSE 'rohit.kumar'
    END
FROM numbers;

